void saveProfile() {
  audio::pause();
  File f = SD.open(format("/profiles/%s/elements.txt", profilename), "w");
  f.write(mario::fire ? '1' : '0');
  f.write(water ? '1' : '0');
  f.write(cuby::earth ? '1' : '0');
  f.write(geometry::wind ? '1' : '0');
  f.close();
  audio::resume();
}

void loadProfile() {
  audio::pause();
  if (!SD.exists(format("/profiles/%s/elements.txt", profilename))) saveProfile();
  File f = SD.open(format("/profiles/%s/elements.txt", profilename), "r");
  mario::fire = f.read() == '1';
  water = f.read() == '1';
  cuby::earth = f.read() == '1';
  geometry::wind = f.read() == '1';
  allElements = mario::fire && water && cuby::earth && geometry::wind;
  elementsTimer = 0;
  f.close();
  audio::resume();
}

